{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/doanhuynhquang/bellabeat-case-study?scriptVersionId=107172983\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"d94c16cc","metadata":{"papermill":{"duration":0.009701,"end_time":"2022-10-04T11:26:44.781014","exception":false,"start_time":"2022-10-04T11:26:44.771313","status":"completed"},"tags":[]},"source":["# R Capstone Bellabeat Case Study\n","\n","## 1.Summary:\n","\n","Bellabeat is a high-tech company that manufactures health-focused smart products.They offer different smart devices that collect data on activity, sleep, stress, and reproductive health to empower women with knowledge about their own health and habits.\n","\n","The main focus of this case is to analyze smart devices fitness data and determine how it could help unlock new growth opportunities for Bellabeat. We will focus on one of Bellabeat's products: Bellabeat app.\n","\n","The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","\n","## 2.Business task:\n","\n","Identify trends in how consumers use non-Bellabeat smart devices to apply insights into Bellabeat's marketing strategy.\n","\n","Stakeholders: \n","* Urška Sršen - Bellabeat cofounder and Chief Creative Officer. \n","* Sando Mur - Bellabeat cofounder and key member of Bellabeat executive team. \n","* Bellabeat Marketing Analytics team.\n","\n","## 3.Prepare phase:\n","\n","#### 3.1 Data source:\n","\n","The data source used for the case study is FitBit Fitness Tracker Data. This dataset is stored in Kaggle and was made available through Mobius.\n","\n","#### 3.2 Data organized and verification:\n","\n","There are 18 csv documents and I have some identification and count the samples size (ID) for each table. I relized the due to limitation of size (30 users) and not having demographic information we could encounter a sampling bias. We are not sure if the sample is representative of the population as a whole."]},{"cell_type":"markdown","id":"6001fa87","metadata":{"papermill":{"duration":0.008479,"end_time":"2022-10-04T11:26:44.799331","exception":false,"start_time":"2022-10-04T11:26:44.790852","status":"completed"},"tags":[]},"source":["| Table Name                     | Type                | Description                                                                                                                                                       |\n","|-----------------|-----------------|---------------------------------------|\n","| dailyActivity_merged           | Microsoft Excel CSV | Daily Activity over 31 days of 33 users. Tracking daily: Steps, Distance, Intensities, Calories                                                                   |\n","| dailyCalories_merged           | Microsoft Excel CSV | Daily Calories over 31 days of 33 users                                                                                                                           |\n","| dailyIntensities_merged        | Microsoft Excel CSV | Daily Intensity over 31 days of 33 users. Measured in Minutes and Distance, dividing groups in 4 categories: Sedentary, Lightly Active, Fairly Active,Very Active |\n","| dailySteps_merged              | Microsoft Excel CSV | Daily Steps over 31 days of 33 users                                                                                                                              |\n","| heartrate_seconds_merged       | Microsoft Excel CSV | Exact day and time heartrate logs for just 7 users                                                                                        